<!DOCTYPE html>
<html lang="zh">

<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <meta name="description" content="快速整理照片，像抖音一样，轻松移动照片到相册">
    <title>照片整理 App</title>
    <style>
        /* 全局样式 */
        body {
            font-family: Arial, sans-serif;
            margin: 0;
            padding: 0;
            background-color: #000;
            color: #fff;
            overflow-x: hidden;
        }

        .container {
            max-width: 100%;
            text-align: center;
            padding: 50px 20px;
        }

        /* 页面顶部 */
        .header {
            margin-bottom: 30px;
        }

        .header h1 {
            font-size: 36px;
            font-weight: bold;
            color: #fff;
            margin: 0;
        }

        .header p {
            font-size: 16px;
            color: #aaa;
            margin-top: 10px;
        }

        /* 特色介绍部分 */
        .features {
            margin-top: 50px;
            text-align: center;
            display: flex;
            justify-content: center;
            flex-wrap: wrap;
        }

        .features h2 {
            font-size: 24px;
            font-weight: bold;
            color: #fff;
            margin-bottom: 30px;
            width: 100%;
        }

        .features .feature-item {
            display: inline-block;
            width: 45%;
            margin: 10px 2.5%;
            text-align: center;
        }

        .features img {
            width: 100%;
            max-width: 300px;
            border-radius: 10px;
        }

        /* 按钮样式 */
        .cta-button {
            background-color: #fff;
            color: #000;
            padding: 15px 30px;
            font-size: 18px;
            font-weight: bold;
            border: none;
            border-radius: 50px;
            cursor: pointer;
            margin-top: 30px;
            text-decoration: none;
        }

        .cta-button:hover {
            background-color: #ddd;
        }

        /* 底部版权 */
        .footer {
            margin-top: 50px;
            font-size: 14px;
            color: #aaa;
        }

        /* 移动端适配 */
        @media (max-width: 768px) {
            .features {
                flex-direction: column;
                align-items: center;
            }

            .features .feature-item {
                width: 90%;
                margin: 10px 0;
            }

            .cta-button {
                padding: 12px 20px;
                font-size: 16px;
            }
        }
    </style>
</head>

<body>

        <!-- 页面头部 -->
        <div class="header">
            <h1>快速整理照片</h1>
